class CollisionBlock {
    constructor( x, y, height = 16 ) {
      this.width = 16;
      this.height = height;
      this.x = x * this.width - 50;
      this.y = y * this.height - 80;
      this.initialY = this.y;
      this.vx = 0;
      this.vy = 0;
    }
    update(){
        this.x += this.vx;
        this.y += this.vy;
    }
    draw(context) {
        context.fillStyle = 'rgba(255, 0, 0, 0.5)';
        context.fillRect(this.x, this.y, this.width, this.height);
    }
  }

export function loadStageCollisions(game){
    stageCollisionSelection(game.currentStage).forEach((position, i) => {
        if(position !== 0){
            game.floorcollisions2D.push(new CollisionBlock(i % 110, Math.floor(i / 110)));
        }
});
    // console.log(game.floorcollisions2D);
}

